} // Less => cw
// Greater => ccw
fn turn((ax, ay): (i32, i32), (bx, by): (i32, i32), (cx, cy): (i32, i32)) -> std::cmp::Ordering { let abx = (bx - ax) as i64; let aby = (by - ay) as i64; let bcx = (cx - bx) as i64; let bcy = (cy - by) as i64; (abx * bcy).cmp(&(aby * bcx))
